import React from 'react';
import './styles/Forms.css';

function Dashboard() {
  return (
    <div className="dashboard">
      <h2>Dashboard</h2>
      <p>Welcome to the Accounting System Dashboard.</p>
      <div className="dashboard-summary">
        <h3>Summary</h3>
        <p>Total Transactions: 0</p>
        <p>Total Budget: $0.00</p>
        <p>Pending Alerts: 0</p>
      </div>
      <div className="dashboard-quick-links">
        <h3>Quick Links</h3>
        <ul>
          <li><a href="/data-entry">Data Entry</a></li>
          <li><a href="/transaction-history">Transaction History</a></li>
          <li><a href="/reports">Reports</a></li>
          <li><a href="/alerts">Alerts</a></li>
        </ul>
      </div>
    </div>
  );
}

export default Dashboard;
